class App extends Component {
  render() {
      return (
          <div>
            <Header></Header>
            <Videos video = {VideoDetails} > </Videos>
            <VideoDes></VideoDes>
            <Comments></Comments>
            <VideoQue></VideoQue>  
          </div>
      )
  }
}


export default App;
